import React from 'react';
import './Technicalskills.css';
const Technicalskills = () => {
    return (
        <div className="education">
        <h3 className="h4tag">Technical skills</h3>
        <h5 className="h5tag">Web Technologies</h5>
        <h6 className="h6tag">HTML5 CSS Java script TypeScript JSON Ajax JQUERY</h6>
        <h5 className="h5tag">Framworks & JavaScript libraries</h5>
        <h6 className="h6tag"> React.js Angular.js, Node.js, bootstrap </h6>
        <h5 className="h5tag">Operating systems</h5>
        <h6 className="h6tag">Windows IOS Linux/Unix</h6>

        </div>
    )}

export default Technicalskills;
